    data: |
      SELECT DISTINCT + - 83 AS col0 FROM tab2 (FORMAT parquet), tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab2

outputs:
  - name: q4432.out
    data: |
      -83
